// and decompresses in milliseconds, giving the user an instant response, which 
// will be even faster on subsequent visits to the site once this file is in the
// cache.
//     Also, my version of passCharsetSize is included - using regex, improving
// speed and brevity whilst retaining code legibility. The entropy calculation
// has been moved into its own function for better reuse, and tweaked to give 
// apropriate entropy to the first character based on NIST's guidelines. The 
// common passwords function has been both moved to its own function and
// re-factored to use a more efficient search.
