var passchk_fast = {};

passchk_fast.passCharsetSize = function(pass)
{
   var charset = new Array( /[0-9]/,
			     /[a-z]/,
			     /[A-Z]/,
                             /[!@#\$%\^&\*\(\)]/,
                             /[\x22\x27\x2b\x2c\x2d\x2e\x2f\x3a\x3b\x3c\x3d\x3e\x3f\x5b\x5c\x5d\x5f\x96\x7b\x7c\x7d\x7e]/,
                             /[\x20]/, 
                             /[^\x20-\x7e]+/
		           );
   var charsetsize = new Array(10, 26, 26, 10, 22, 1, 32 + 128);
   var chars = 0;	

   for(var i = 0; i < charset.length; i++)
       if (charset[i].test(pass)) chars += charsetsize[i];

   return chars;
}

passchk_fast.getIndex = function(c) {
   c = c.charAt(0).toLowerCase();
   if (c < 'a' || c > 'z') return 0;
   return c.charCodeAt(0) - 'a'.charCodeAt(0) + 1;
}

passchk_fast.passEntropy = function(pass)
{
   if (pass.length < 1) return 0;
   var c, aidx = 0, bits = 0, charSet, plower;
   
   
   // calculate number of bits of entrop per char for this 
   // password, based on its charset size 
   charSet = Math.log(this.passCharsetSize(pass)) / Math.log(2);

   // calc number of bits of entropy for first char
   bits = Math.log(this.passCharsetSize(pass.charAt(0))) / Math.log(2);
   if (pass.length == 1) return bits;

   plower = pass.toLowerCase();
   aidx = this.getIndex(plower.charAt(0));
   
   for (var b = 1; b < plower.length; b ++)
   {
	var bidx = this.getIndex(plower.charAt(b));
	c = 1.0 - this.Frequency_Table[aidx * 27 + bidx];
	bits += charSet * c * c;  // Squared = assmume they are good guessers
	aidx = bidx;
   }
   return bits;
}

passchk_fast.passCommon = function(pass)
{
  return this.Common_Words.indexOf(pass.toLowerCase()) != -1;
}

//+ Jonas Raoni Soares Silva
//@ http://jsfromhell.com/string/rot13 [rev. #1]
String.prototype.rot13 = function(){
    return this.replace(/[a-zA-Z]/g, function(c){
        return String.fromCharCode((c <= "Z" ? 90 : 122) >= (c = c.charCodeAt(0) + 13) ? c : c - 26);
    });
};

